var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/cmsimde.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Week', 'text': 'Week1~Week5 \n Week6~Week9 \n Week10~Week14 \n Week15~Week18', 'tags': '', 'url': 'Week.html'}, {'title': 'Week1~Week5', 'text': '建立個人倉儲cd2020 \n \n \n 下載 2019Fall 可攜套件，解壓縮後開啟並啟動Start \n \n \n 登入Github，創建新倉儲，命名為cd2020 \n \n \n 在可攜套件開啟的Cmd 用 command進入tmp資料夾 \n \n \n 輸入 git clone  https://github.com/個人學號/cd2020 \xa0來下載個人倉儲 \n \n \n 下載完成後進入cd2020資料夾，輸入 git submodule add\xa0\xa0 https://github.com/mdecourse/cmsimde \xa0來添加子模塊 \n \n \n 進入cmsimde資料夾，將up_dir資料夾裡的所有項目複製到cd2020裡 \n \n \n 完成後用Cmd在cmsimde資料夾裡輸入python wsgi.py，即可編輯網誌 \n \n \n 編輯完倉儲內的資料後，在Cmd依序輸入git status > git add . > git commit -m "標題" > git push完成資料上傳 \n \n \n 在Github個人倉儲cd2020裡，將倉儲的branch改成Master branch 完成倉儲建立 \n \n \n \n 更新Python版本 \n \n \n 從 官方網站 下載 3.8.2 版本(64位元) \n \n \n 開啟安裝檔，選擇自定義安裝 \n \n \n 將pip選項 取消 勾選後再選擇安裝位置，完成安裝 \n \n \n 用編輯器開啟start.bat，將編碼裡所有py373改成py382後儲存，重新啟動可攜套件 \n \n \n 在cmd裡輸入python get-pip.py來安裝pip套件 \n \n \n 輸入python pip install  軟件名稱  來安裝軟件 \n \n \n 安裝的軟件有 Flask Markdown Ixml bs4 flask_cors pelican leo \n \n \n 完成Python版本更新 \n \n \n \n 組別分工 \n \n 在線上直播討論並分工 \n', 'tags': '', 'url': 'Week1~Week5.html'}, {'title': 'Week6~Week9', 'text': '', 'tags': '', 'url': 'Week6~Week9.html'}, {'title': 'Week10~Week14', 'text': '', 'tags': '', 'url': 'Week10~Week14.html'}, {'title': 'Week15~Week18', 'text': '', 'tags': '', 'url': 'Week15~Week18.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://127.0.0.1:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};